import React from 'react'
import './SearchBar.css'
import { BiSearchAlt2 } from 'react-icons/bi';

function SearchBar(){
    return(
        <div className='search'>
            <div className='search1'>
                <input></input>
                <BiSearchAlt2></BiSearchAlt2>
            </div>
        </div>
    )
}
export default SearchBar;
